import React from 'react';

import classes from './NavigationItems.module.css';
import NavigationItem from './NavigationItem/NavigationItem';
import Logo from '../../../components/Logo/Logo';

const navigationItems = (props) => {

    let cards = props.NavigationLink.map((NavigationLinks, index) => {
        return (
            NavigationLinks.map((NavigationLink, index) => {
                return(
                    <NavigationItem link={NavigationLink.destination} exact>{NavigationLink.linkText}</NavigationItem>
                );
            })          
        );
    })

    return(
        <ul className={classes.NavigationItems}>
            <NavigationItem link="/" exact>
                <Logo />
            </NavigationItem>
            <NavigationItem link="/aboutUs" exact>About Us</NavigationItem>
            <NavigationItem link="/contactUs">Get in Touch</NavigationItem>
        </ul>
    );

}


export default navigationItems;
